CREATE FUNCTION public.calc_score_b4(inpt_midterm numeric, inpt_endterm numeric, inpt_weigth numeric) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
declare
    tmp numeric;
begin
    tmp = inpt_midterm * (1.0 - inpt_weigth) + inpt_endterm* inpt_weigth;
    return case 
    when tmp is null then 0
    when tmp <= 3.9 then 0
    when tmp <= 4.9 then 1 
    when tmp <= 5.4 then 1.5
    when tmp <= 6.4 then 2
    when tmp <= 6.9 then 2.5
    when tmp <= 7.9 then 3
    when tmp <= 8.4 then 3.5
    else 4
    end;
end;
$$;


