CREATE PROCEDURE public.end_semester()
    LANGUAGE plpgsql
    AS $$

DECLARE current_semester varchar := get_current_semester();

BEGIN
ALTER POLICY teacher_update on enrollments using(false);
--determine whether student passed a class or not
update enrollments set passed = true where mid_term >3 and end_term >3;
--update student warning_level according to the credit a student failed.
WITH total_failed_credit AS (
    SELECT 
        e.student_id, 
        c.semester, 
        COALESCE(SUM(s.credit), 0) AS total_failed_credits
    FROM 
        enrollments e 
    LEFT JOIN 
        classes c ON e.class_id = c.class_id AND e.passed = false and c.semester =current_semester
    LEFT JOIN
        subjects s ON c.subject_id = s.subject_id
    GROUP BY 
        e.student_id, 
        c.semester
)
UPDATE students 
SET 
    warning_level = LEAST(GREATEST(
        CASE
            WHEN t.total_failed_credits < 8 THEN warning_level - 1
            WHEN t.total_failed_credits < 16 THEN warning_level + 1
            ELSE warning_level + 2
        END, 0), 3),
    accumulated_credit = accumulated_credit +
        (28 - 4 * warning_level - semester_credit - 
            COALESCE((SELECT total_failed_credits 
             FROM total_failed_credit t1 
             WHERE t1.student_id = students.student_id 
             AND t1.semester = current_semester), 0)
        )
FROM total_failed_credit t
WHERE students.student_id = t.student_id;

--recalculate student GPA
refresh materialized view student_gpa;
--update student CPA 
update students 
set cpa =(
    select (sum(sss.score_b4*sss.credit) / sum(sss.credit)) 
    from student_subject_score sss
    where students.student_id = sss.student_id
);

--Calculate student scholarship and deduct from debt
with student_amount as(
select
  s.student_id,
  sum(sch.amount) as amount
from
  scholarships sch
  join students_scholarships ss on sch.scholarship_id = ss.scholarship_id and ss.accepted=true
  join students s on s.student_id = ss.student_id
group by
  s.student_id
  )
 
update students set debt = debt - student_amount.amount FROM student_amount 
WHERE students.student_id = student_amount.student_id;

--update graduation status 
update students set graduation_status = 'expelled' where warning_level=3 or debt > 0;
--graduate valid student
update students s set graduation_status ='graduated' where accumulated_credit =
(select total_credit from programs p 
where p.program_id= s.program_id );
update current_period set current_period='end_semester';

END;

$$;


