--

CREATE FUNCTION public.handle_class_validation() RETURNS trigger
    LANGUAGE plpgsql
    AS $$

DECLARE overlap boolean;
BEGIN
    --CHECK IF TEACHER IS VALID TO TEACH THE SUBJECT OR NOT
    IF NOT (EXISTS(SELECT 1 FROM subjects s JOIN teachers t ON s.school_id=t.school_id WHERE teacher_id = NEW.teacher_id AND subject_id = NEW.subject_id LIMIT 1)) THEN
        RAISE EXCEPTION 'Teacher is not authorized to teach this subject';
        RETURN NULL;
    END IF;

    --CHECK IF THERE IS ANY OVERLAPPING CLASSES IN THE SAME TIME PERIOD OR NOT
    WITH same_day_location AS (SELECT start_time, end_time FROM classes WHERE location=NEW.location AND day_of_week=NEW.day_of_week)
    SELECT EXISTS (SELECT 1 FROM same_day_location WHERE (start_time, end_time) OVERLAPS (NEW.start_time, NEW.end_time)) INTO overlap;
    IF overlap THEN
        RAISE EXCEPTION 'The time period of the classes is already occupied!';
        RETURN NULL;
    END IF;

    RETURN NEW;
END;

$$;


