student_cre numeric;
subjectID varchar;
open_or_full integer;
cre numeric;
new_class_day week_days;
new_class_start_time time;
new_class_end_time time;
BEGIN

bd := clock_timestamp();

select program_id,semester_credit into programID,student_cre from students where student_id=NEW.student_id LIMIT 1; 
  SELECT 
    subject_id, is_open::integer * (capacity - enrolled_count)
    INTO subjectID, open_or_full
    FROM classes 
    WHERE class_id = NEW.class_id 
    LIMIT 1;
	SELECT into cre credit FROM subjects WHERE subject_id=subjectID;
--CLASS CLOSED OR FULL
IF open_or_full <=0 THEN
RAISE EXCEPTION 'Class is not opened or is full already'; 
RETURN NULL;
END IF;

--CLASS IN PROGRAM OR NOT
kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 1: %', kt - bd;
bd := clock_timestamp();

IF  (select exists(select 1 from subjects_programs where program_id = programID AND subject_id = subjectID ) ) THEN 
ELSE
RAISE EXCEPTION 'Your program doesnt contain this subject';RETURN NULL;

END IF;
--STUDENT HAS ENOUGH CREDIT OR NOT
kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 2: %', kt - bd;
bd := clock_timestamp();

IF student_cre -   cre  < 0  THEN
    RAISE EXCEPTION 'You dont have enough credit to register this subject';RETURN NULL;
END IF; 
--CREATE TEMP TABLE
kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 3: %', kt - bd;
--CHECK SUBJECT CONDITION

bd := clock_timestamp();

IF  exists( select
  1
from
  (
    select
      *
    from
      subjects_conditions
    where
      main_subject_id = subjectID
      LIMIT 2
  ) as t1
  left join (
     select
      subject_id
    from
      classes
    where
      class_id IN (
        select
          class_id
        from
          enrollments
        where
          student_id = NEW.student_id
          and passed = true
      )
  ) as t2
  
 on t1.main_subject_id=t2.subject_id 
where  t2.subject_id is NULL)
   THEN
RAISE EXCEPTION 'You still havent passed the required subjects for this subject: % %', NEW.student_id, subjectID;
RETURN NULL;
END IF;

--CHECK SUBJECT OVERLAP
kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 4: %', kt - bd;
bd := clock_timestamp();

IF EXISTS (SELECT subject_id
FROM classes
where class_id in (select class_id from enrollments where student_id=NEW.student_id) and semester = current_semester and subject_id=subjectID) THEN 

RAISE EXCEPTION 'You have registered a class with the same subject in this semester:';
END IF;


--CHECK TIME OVERLAP
kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 5: %', kt - bd;
bd := clock_timestamp();

SELECT day_of_week, start_time, end_time 
into new_class_day, new_class_start_time, new_class_end_time 
from classes where class_id = NEW.class_id LIMIT 1;

IF EXISTS
(SELECT 1 from (select day_of_week, location, start_time, end_time from classes where class_id in (select class_id from enrollments where student_id=NEW.student_id) and semester = current_semester)
where day_of_week = new_class_day
AND (new_class_start_time,new_class_end_time) OVERLAPS (start_time, end_time) ) THEN 
RAISE EXCEPTION 'You already have a class in this time period';
END IF;

kt := clock_timestamp();
	 RAISE NOTICE 'Trigger execution time for checking Part 6: %', kt - bd;
	 
RETURN NEW;
END;
$$;


