--

CREATE FUNCTION public.program_credit_recalculation() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE subject_credit numeric;
BEGIN
SELECT credit into subject_credit from subjects where subject_id=NEW.subject_id;
IF (TG_OP = 'INSERT') THEN
update programs set total_credit=total_credit + subject_credit
where program_id=NEW.program_id;
END IF;
IF (TG_OP = 'DELETE') THEN
update programs set total_credit=total_credit - subject_credit
where program_id=NEW.program_id;
END IF;
RETURN NEW;
END;
$$;


